import { 
    ContainerServices,
    Items
} from "./styled";



export function Services(){
    const services = [
        {
            projeto: "Radio Agioa FM",
            lingagens: "PHP, js, HTML5, bootstrap, css3",
            img: "teste",
            site: "www.radioaguiafm.com.br"  
        },
        {
            projeto: "Radio Agioa FM",
            lingagens: "PHP, js, HTML5, bootstrap, css3",
            img: "teste",
            site: "www.radioaguiafm.com.br"  
        },
        {
            projeto: "Radio Agioa FM",
            lingagens: "PHP, js, HTML5, bootstrap, css3",
            img: "teste",
            site: "www.radioaguiafm.com.br"  
        }
    ]

    return(
        <ContainerServices>
            {
                services.map((item, index) => {
                    <Items>
                        {item.projeto}
                    </Items>
                })
            }

        </ContainerServices>
    )
}
